import React from "react";

import './css/Services.css';
import { BiPyramid } from "react-icons/bi";

class Services extends React.Component {

  render() {
    return (
      <div className='Section'>
        <div className="Container">
          <div className="Service-Item-Container">
            <p>
              <BiPyramid />
            </p>
            <p>
              <span className='Titles'>development</span>
            </p>
            <p>
              Lorem ipsum dolor sit amet, consectetuer adipiscing elit. Donec quis nibh at felis congue commodo. Nullam sit amet magna in magna gravida vehicula. Nulla est. Mauris dictum facilisis augue. Duis risus. Nulla accumsan, elit sit amet varius semper, nulla mauris mollis quam, tempor suscipit diam.
            </p>
          </div>
          <div className="Service-Item-Container">
            <div><BiPyramid /></div>
            <div>development</div>
          </div>
        </div>
      </div>
    );
  }
}

export default Services;
